import React from 'react';
import { useParams } from 'react-router-dom';
import useServices from '../../hooks/useServices';

const ServiceInfo = () => {
    const [services] = useServices();
    const { id } = useParams();
    return (
        <div>
            this is service.name {id}
        </div>
    );
};

export default ServiceInfo;
